import React, {useState} from 'react';
import axios from 'axios';
const Info=()=>{
  const [datas,setDatas]=useState(null)
    axios.get("http://localhost:3001/read")
    .then((data)=>{
      setDatas(data)
    })
    .catch(err =>alert(err.message))
  return <>
  {data.payload.findAll.map(todo =><li key={todo.id}>{}</li>)}
  </>
}
export default Info;
